import React, { Component } from 'react';
import ListItem from './Listitem';

class Todolist extends Component {

    render() {
        const todolist = [
            'React practice',
            'Basketball' 
        ];
        return (
            <div>
                {
                    todolist.map(item => <ListItem item = {item}/>)
                }
            </div>
        );
    }
}

export default Todolist;
